package bsicProgramInjava;

public class SwapTwoNumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int num1=5;
		int num2=10;
		
		num1=num1+num2;
		num2=num1-num2;
		num1=num1-num2;
		
		System.out.println("num1 = "+num1);
		System.out.println("num2 = "+num2);
	}

}
